import React, {Component} from 'react';
import PropTypes from 'prop-types';

class RenderTables extends Component {

    checkTable

    render() {
        return (
            <div className={"tables"}>
                <div className={"row-tables"}>
                    <div onClick={""} className={"small-tables"}>
                        <div>A1 *4</div>
                    </div>
                    <div className={"small-tables"}>
                        <div>A2 *4</div>
                    </div>
                    <div className={"large-tables"}>
                        B1 *4
                    </div>
                </div>
                <div className={"row-tables"}>
                    <div className={"small-tables"}>
                        <div>A3 *4</div>
                    </div>
                    <div className={"small-tables"}>
                        <div>A4 *4</div>
                    </div>
                    <div className={"large-tables"}>
                        B2 *4
                    </div>
                </div>
            </div>

        );
    }
}

RenderTables.propTypes = {};

export default RenderTables;
